						if(SourceObjectDomain != _unmodified_SourceObjectDomain)
							return true;
						if(TargetObjectID != _unmodified_TargetObjectID)
							return true;
						if(TargetObjectName != _unmodified_TargetObjectName)
							return true;
						if(TargetObjectDomain != _unmodified_TargetObjectDomain)
							return true;
				
						return false;
					}
				}

