							break;
						case "LastAuthorEmail":
							LastAuthorEmail = value;
							break;
						case "LastAuthorAccountID":
							LastAuthorAccountID = value;
							break;
						default:
							throw new InvalidDataException("Primitive parseable data type property not found: " + propertyName);
					}
	        }
