				private object FindFromObjectTree(string objectId)
				{
					{
						var item = SystemErrorItems;
						if(item != null)
						{
							object result = item.FindObjectByID(objectId);
							if(result != null)
								return result;
						}
					}
					{
						var item = MessageContent;
						if(item != null)
						{
							object result = item.FindObjectByID(objectId);
